import logo from './logo.svg';
import './App.css';
import {Testimonial_Container} from './components/Testimonial_Container';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          <Testimonial_Container/>
        </p>
      </header>
    </div>
  );
}

export default App;
